import React, { Component } from "react";
import AOS from "aos";
import "aos/dist/aos.css";

export default class Experience extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    {
      AOS.init();
    }
    return (
      <div>
        <p
          className="text"
          data-aos="slide-up"
          data-aos-easing="linear"
          data-aos-duration="500"
          data-aos-anchor-placement="top-center"
          data-aos-offset="-100"
        >
          My Job Experiences
        </p>
      </div>
    );
  }
}
